import React, {useEffect} from "react"
import Cell from "./cell"
import style  from "./style.module.css"

const Grid = ( ) => {

    const cells = () => {
        const temp = [];
        for(let x = 0; x < 10; x++) {
            for(let y = 0; y < 10; y++) {
                temp.push(<Cell x={x} y={y}/>)
            }
        }
        return temp;
    }
    return <div className={style.gridSetting}>
       {cells.map((item) => item)}   
    </div>;
}

export default Grid;
